import React, {Component} from "react";
import {withStyles} from "@material-ui/core";
import PropTypes from  "prop-types";
import Path      from  "./PathComponent";
import Map       from  "./Map";
import Table     from  "./Table";

console.log("Inside Dataset.")

const styles = theme => ({
    body: {
        margin: theme.spacing.getMaxWidth.margin,
	width: '100%',
	height: '90%',
    },
});

function Switcher(props) {
    const { state } = props;
    if (props.state.Show.getLayoutMode(props.state) === props.state.Show.code.mMap) {
      return <Map state={state}/>
    } else {
      return <Table state={state}/>
   } 
};

class Dataset extends Component {
    render() {
        const { classes, state } = this.props;
        return (
            <div className={classes.body}>
                <Path     state={state}/>
		<Switcher state={state}/>
            </div>
        );
    }

}

Dataset.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Dataset);
